  // const images = dogPixels.concat(catPixels);

  const images = [dog, cat];
  const labels = ['dog', 'cat'];
  await mlClassifier.addData(images, labels, 'train');
  mlClassifier.train({
    callbacks: {
      onTrainBegin: () => {
        console.log('training begins');
      },
      onTrainEnd: () => {
        console.log('training ends');
      },
    },
  });
})();
